ScriptsAfterLoad.Script:
DECLARE @SQL VARCHAR(MAX);

SELECT
	@SQL = ISNULL(@SQL, '')
+	'UPDATE [_tmp_ZL] SET ['
+	name
+	'] = REPLACE(['
+	name
+	'], ''"'', '''');'
FROM sys.columns
WHERE object_id = OBJECT_ID('_tmp_ZL', 'U');

EXECUTE(@SQL);

BEGIN TRY
	DROP TABLE tmp_ZL;
END TRY
BEGIN CATCH

END CATCH;
